import { Card } from 'semantic-ui-react';



function PlacesSummary({ placesdata }) {

    console.log(placesdata)
    function mapPlaces(placesdata) {
        return placesdata.map(place => ({
            header: place.name,
            //meta: place.description,
            color: 'teal',
            fluid: true,
            childkey: place._id,
            // href: `/product?_id=${place._id}`,
            //image: place.picture,

        }))
    }


    return <>
        <div class="row">
            <div class="col-md-4 ftco-animate">
                <div class="project-wrap">
                    <a href="#" class="img" style="background-image: url(https://upload.wikimedia.org/wikipedia/commons/7/71/Kenta_Kerr.JPG);"></a>
                    <div class="text p-4">
                        <span class="price">$300/person</span>
                        <span class="days">8 Days Tour</span>
                        <h3><a href="#">  </a></h3>
                        <p class="location"><span class="ion-ios-map"></span>  </p>
                        <ul>
                            <li><span class="flaticon-shower"></span>2</li>
                            <li><span class="flaticon-king-size"></span>3</li>
                            <li><span class="flaticon-mountains"></span>  </li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    </>;
}


export default PlacesSummary;
